    constructor(props) {
      super(props);
      this.winner = this.props.winner;
    }

    render() {
      return (
        <div
          className="winner"
        >
          <p>And the winner is: {}</p>
          <Button>
              <Link to='/'>
              Play again!    
              </Link>
          </Button>
        </div>
      );
    }
  }
